        return <>
            <div className='home-wrap'>
                <div>
                    <Container>
                        1
                    </Container>
                </div>
                <div className='icon-area'>
                    <Container>
                        1
                    </Container>
                </div>
                <Container>3</Container>
            </div>
        </>;
    }
}
